import React from "react";
import { Switch, Route } from 'react-router-dom';
import Navbar from "./Navbar";
import '../Styles/App.css';

function App() {
  return (
    <div className="App">
      <Navbar />
      <Switch>
        <Route path="/flies">
          <Flies />
        </Route>
        <Route path="/bugs">
          <Bugs />
        </Route>
        <Route path="/streams">
          <Streams />
        </Route>
        <Route path="/">
          <Home />
        </Route>
      </Switch>
    </div>
  );
}

export default App;
